  total_edges: (.graph.edges | length),
  layer_distribution: (.graph.nodes | group_by(.formality_layer) | map({
    layer: (if .[0].formality_layer == 0 then "U0" elif .[0].formality_layer == 1 then "U1" elif .[0].formality_layer == 2 then "U2" else "U3" end),
    count: length
  })),
  kind_distribution: (.graph.nodes | group_by(.kind) | map({
    kind: .[0].kind,
    count: length
  })),
  edge_kinds: (.graph.edges | map(.[2].kind) | group_by(.) | map({
    kind: .[0],
    count: length
  }))
}
' .spec/specs.json

